<!DOCTYPE html>
<html lang="zh-cn">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>FreeDog</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            text-align: center;
            background-color: #f7f7f7;
            margin: 0;
            padding: 0;
        }

        .logo {
            margin-top: 40px;
            display: block;
            width: 250px; 
            height: auto;
            margin-left: auto;
            margin-right: auto;
        }

        .search-container {
            background-color: #e0e0e0;
            padding: 20px;
            border-radius: 10px;
            display: inline-block;
            margin-top: 20px;
        }

        input[type="text"] {
            font-size: 16px;
            padding: 10px;
            width: 300px;
            border: 2px solid #ccc;
            border-radius: 5px;
        }

        input[type="submit"] {
            font-size: 16px;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            background-color: #4CAF50;
            color: white;
            cursor: pointer;
            margin-left: 10px;
        }

        input[type="submit"]:hover {
            background-color: #45a049;
        }

        .quick-links {
            margin-top: 20px;
            margin-left: 40%;
            margin-right: 40%;
            padding: 0.1%;
            font-size: 16px;
            background-color: #e0e0e0;
            border-radius: 10px;
        }

        .quick-links a {
            color: #0073e6;
            text-decoration: none;
            margin: 0 10px;
        }

        .quick-links a:hover {
            text-decoration: underline;
        }

    </style>
</head>
